(refs, cache) =>
{
	// inputs
	var request = (Newtonsoft.Json.Linq.JObject)refs["request"];
	var item = (Newtonsoft.Json.Linq.JValue)refs["item"];
	var value = (string)refs["value"];

	// const
	const int CurrentTaxBucket = 1;
	const string CurrentColumn = "TypeCode";

	// fetch the tax object
	var taxSection = item.Parent.Parent["Tax"];
	if (taxSection == null)
	{
		return null;
	}

	// all the type codes from this line item
	var lineItemTypeCodes = taxSection.Select(ts => (Newtonsoft.Json.Linq.JValue)ts["TypeCode"]).ToList();
	if (!lineItemTypeCodes.Any())
	{
		return null;
	}

	// allocated buckets
	if (!cache.TryGetValue("tax", out var taxAllocObj))
	{
		cache["tax"] = taxAllocObj = new Dictionary<string, int>();
	}

	// ensure it's the correct slot
	var taxAlloc = (Dictionary<string, int>)taxAllocObj;
	var taxIndex = taxAlloc.Any() ? taxAlloc.Values.Max() + 1 : 1;
	foreach (var litc in lineItemTypeCodes)
	{
		var typeCode = litc.Value as string;
		if (typeCode == null) continue;
		if (!taxAlloc.ContainsKey(typeCode))
		{
			taxAlloc[typeCode] = taxIndex++;
		}
	}
	var taxAllocR = taxAlloc.ToDictionary(p => p.Value, p => p.Key);

	// identify the current tax type code, skip non-matching
	if (!taxAllocR.TryGetValue(CurrentTaxBucket, out var currentTypeCode))
	{
		return null;
	}

	// select the tax bucket with the matching tax type code
	var currentTaxBlock = taxSection.FirstOrDefault(ts => (string)((Newtonsoft.Json.Linq.JValue)ts["TypeCode"]) == currentTypeCode);
	if (currentTaxBlock == null)
	{
		return null;
	}

	// select the column
	var columnValue = (Newtonsoft.Json.Linq.JValue)currentTaxBlock[CurrentColumn];

	return columnValue.Value;
}

